import React from "react";
import { Link, Route, Routes } from "react-router-dom";

function Register(){
    return(
        <div className="login">
        <h1 className="login__title">Регистрация</h1>

        <form className="input__form">
            <input className="login__input " placeholder="Email"></input>
            <input className="login__input " placeholder="Пароль"></input>
            <button className="login__button">Зарегистрироваться</button>
            <p>Уже зарегистрированы?   <Routes>
        <Route path='/sign-up' element={
          <Link className="header__auth" to="/sign-in">Войти</Link>
        }></Route>
      </Routes></p>
        </form>
    </div>
    )
}
export default Register
